import{_ as p,c as t,o as g,a1 as r}from"./chunks/framework.DlD7sw_h.js";const S=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"vgvi/xb1.md","filePath":"vgvi/xb1.md"}'),s={name:"vgvi/xb1.md"};function I(E,A,C,n,o,B){return g(),t("div",null,A[0]||(A[0]=[r('<p><strong><strong>选择性必修一 《当代国际政治与经济》 知识提纲</strong></strong></p><p><strong><img src="data:image/png;base64,"> 第一课国体与政体</strong></p><p><strong>1.1国家是什么</strong></p><p>1.国家</p><p>（1）国家的产生，国家是阶级矛盾不可调和的产物和表现。</p><p><strong>（2）国家的基本要素：人口、领土、政权和主权，它们是国家存在和发展不可缺少的基本条件，其中最重要的是主权。主权是国家的生命和灵魂。</strong></p><p><strong>（3）国家的本质，国家是经济上占统治地位的阶级进行阶级统治的工具，统治阶级的性质决定国家的性质。</strong></p><p><strong>（4）国家的根本职能是政治统治职能，也具有社会管理职能。</strong></p><p>2．民主与专政</p><p>（1）民主的含义：是指在统治阶级范围内，按照平等的原则和少数服从多数的原则共同管理国家事务的国家制度。民主具有鲜明的阶级性：民主只是属于统治阶级的，体现统治阶级的意志和利益。世界上不存在超阶级的民主。</p><p>（2）专政的含义：统治阶级凭借国家权力，强制被统治阶级服从其意志。</p><p>（3）联系：民主与专政是辩证统一的。民主是专政的基础，专政是民主的保障。凡实行民主制度的国家必然包括一定阶级的民主，同时包括对其他阶级的专政，民主与专政相互依存。</p><p>3.当代的不同国家类型：社会主义国家、资本主义国家。</p><p><strong>（1）新型的民主与新型的专政，体现着社会主义国家的本质特征。</strong></p><p><strong>我国是人民民主专政的社会主义国家，是新型民主与新型专政的统一。不同于一切剥削阶级国家（包括与资本主义国家相比），享有民主的主体不同，专政的对象也不同。我国对占人口绝大数的人民实行民主，对极少数的敌对分子实行专政。人民民主具有最广泛、最真实、最管用的优点，社会主义民主优于资本主义民主。</strong></p><p><strong>（2）资本主义民主：具有虚伪性和欺骗性。在资本主义国家，资产阶级运用金钱的力量，以民主的形式掩盖其国家的阶级性质，实质是维护资产阶级的统治和根本利益。</strong><a id="_Toc30211"></a></p><p><strong>4.国体与政体的关系</strong></p><table><tr><td colspan="2"></td><td><p><strong>国体</strong></p></td><td><p><strong>政体</strong></p></td></tr><tr><td rowspan="3"><p><strong>区别</strong></p></td><td><p>含义</p></td><td><p><strong>即国家性质，反映社会各阶级在国家中的地位</strong></p></td><td><p><strong>即国家政权的组织形式，也就是国家管理形式</strong></p></td></tr><tr><td><p>国家制度</p></td><td><p>内容</p></td><td><p>形式</p></td></tr><tr><td><p>反映问题</p></td><td><p>国体说的是“谁掌握政权”的问题，它规定了国家的性质</p></td><td><p>政体说的是“如何掌握政权”的问题，它规定了国家的管理形式</p></td></tr><tr><td><p><strong>联系</strong></p></td><td colspan="3"><p>国体与政体是相互联系、相互依存的：</p><p>①<strong>国体决定政体，政体体现国体，一定的政体服务于一定的国体</strong>。适当的政体能够巩固国体，不适当的政体会危害国体</p><p>②<strong>政体具有相对独立性。</strong>由于地理环境、历史渊源、文化传统、社会习惯、发展程度等因素的不同，相同国体的国家也会采取不同的政体</p></td></tr></table><p>奴隶制和封建制度国家大都实行专制政体。现代国家的国体基本是民主与专政的统一，政体基本采取民主政体。世界上没有任何两个国家的政体是完全一样的。</p><p>5.现代民主政体的共同特征——代议制</p><p>（1）含义：代议制就是由选举产生的、代表民意的机关来行使国家权力的制度。</p><p>（2）作用：现代国家，无论是资本主义国家还是社会主义国家，大都实行代议制。代议制是公民和国家之间的政治纽带。</p><p><strong>1.2 国家的政权组织形式（政体类型）</strong></p><p>6.<strong>人民代表大会制度</strong></p><p><strong>（1）地位：人民代表大会制度是我国的政体，也是我国的根本政治制度。是中国共产党把马克思列宁主义基本原理同中国具体实际相结合的伟大创造，是人类政治制度史上的伟大创造。人民民主专政的新中国，采用人民代表大会制度作为政权组织形式，是人民的选择、是历史的必然。</strong></p><p><strong>（2）作用：</strong></p><p><strong>①人民代表大会制度，作为人民民主专政的社会主义国家的政权组织形式，决定着国家的其他具体制度。它是中国人民当家作主的重要途径和最高实现形式，是中国特色社会主义政治文明的重要制度载体。</strong></p><p><strong>②人民代表大会制度符合中国国情和实际，体现社会主义国家性质，是保证人民当家作主、实现中华民族伟大复兴的好制度。我们要继续坚持和完善这一根本政治制度。</strong></p><p>7.民主共和制和君主立宪制--国家元首的产生方式不同</p><p>(1)民主共和制（如美国、法国、德国等）</p><p>①原则:遵循民主基本原则建立起来的一种政体。</p><p>②特点:国家元首一般由选举产生的。</p><p><strong>③</strong>本质:<strong>在发达资本主义国家，资产阶级运用金钱的力量，以民主的形式掩盖国家的阶级性质。民主共和制是资产阶级维护其统治的最好政治外壳。</strong></p><p>（2）君主立宪制（如英国、日本、西班牙等)</p><p>①特点:国家元首由世袭的君主担任。但在宪法框架内,君主的权力受到不同程度的限制（<strong>无实权</strong>）。</p><p>②存在原因:君主立宪制是资产阶级革命不彻底或对君主制进行改良的产物。</p><p><strong>③</strong>评价:君主立宪制保留了君主制的外壳甚至某些实质性内容。但实行君主立宪制的资本主义国家，国家政权的实际运行与民主共和制国家大体相同。</p><p>8.议会制和总统制--立法机关与行政机关的关系不同</p><p>（1）议会制：英德日意等（议会是权力中心： 议会具有立法、组织和监督政府、决定财政预算等权力）</p><p>①政府以议会为基础产生，政府首脑由占议会多数席位的政党和政党联盟来组织，政府成员通常必须是议会议员。②政府总揽国家的行政大权，向议会负责。政府受议会监督，定期向议会报告工作。</p><p><strong>③</strong>当议会对政府表示不信任时，政府就得集体辞职，由国家元首制定人员重新组织政府；或重新进行议会选举，成立新的政府。（执政党：在议会大选中获胜的政党或政党联盟）</p><p>（2）总统制：美国、韩国、巴西等（权力中心——总统 总统组织政府）</p><p>①总统不由议会产生而由选举产生，有任期。总统不对议会负责，只对选民负责，但在某些重大事务上可能会受到议会的制约。</p><p>②总统既是国家元首又是政府首脑，总揽行政大权。政府不对议会负责，向总统负责。</p><p><strong>③</strong>政府成员与国会议员不能兼任。（执政党：总统所属政党）</p><p>（3）半总统制：如法国</p><p>既有议会制：①内阁由在议会中占多数的政党组成；②政府中仍设总理，向议会负责等特点。</p><p>又有总统制：①作为国家元首的总统掌握着国家最高行政权力；②总统由选民直接选举产生，国会仅能从立法上对其实施影响，但不能利用不信任案迫使其辞职。</p><p><strong>1.3政党和利益集团</strong></p><p>9.政党</p><p>（1）产生：政党是在阶级的基础上产生的，是阶级斗争发展到一定阶段的产物。</p><p>（2）作用：在现代国家的政治体系中，以掌握政权、统治国家为目标的政党发挥着极其重要的作用。</p><p>（3）主要目标：政党是有组织的政治团体，通常以执政为主要目标；也有一些政党不谋求执政，但积极致力于推广某种政治思想、维护某种政治利益。</p><p>（4）主要手段：政党争取执政的主要手段是参加选举。</p><p>（5）政党类型：</p><p><strong>①资本主义国家政党制度的类型有一党制、两党制和多党制。资本主义国家的政党政治，无论采取什么样的形式，都无法改变其维护资产阶级利益、欺骗人民大众的根本性质。</strong></p><p><strong>②中国共产党领导的多党合作和政治协商制度是我国一项基本政治制度，是中国共产党、中国人民和各民主党派、无党派人士的伟大政治创造，是从中国土壤中生长出来的新型政党制度</strong>。</p><p>10.利益集团--现代政治体系的重要组成部分</p><p>（1）含义：是指具有共同利益，向政府或社会提出诉求，或以合法手段施加压力，借以影响公共政策，以争取其团体利益及其成员利益的社会团体。</p><p>（2）影响政府决策的途径：游说、宣传、助选、集会游行、司法诉讼等。</p><p>（3）类型：自利型利益集团（商会、医生协会等）；公益型利益集团（妇女权益保障组织、绿色环保组织等）。</p><p>（4）作用：</p><p>①积极作用：利益集团起着充当公民与政府间桥梁的作用，在一定程度上会起到缓和社会矛盾的作用。</p><p>②消极作用：利益集团具有相当强的欺骗性和隐蔽性，归根结底是为资产阶级政治统治服务的，无法从根本上解决不同阶级之间的矛盾。</p><p><strong>第二课 国家的结构形式 </strong></p><p><strong>2.1 主权统一与政权分层 </strong></p><p>11.国家主权</p><p>（1）含义:国家主权是一个国家独立自主处理自己内外事务，管理自己国家的最高权力。是现代国家得以存在的法理依据,它是统一的、不可分割的,是一个国家对其管辖区域所拥有的至高无上的、排他性的政治权力。</p><p>特点:国家主权是一种自主自决的最高权威,没有任何其他权力主体可以对其加以否决或驳回。</p><p>表现:独立自主的对外交往是国家主权的重要体现。</p><p>取得方式：国家主权通常以法律形式在宪法中加以规定，对外则表现为国家之间的相互承认。</p><p>（2）重要性:国家主权是国家最重要的构成要素，国家主权的丧失意味着国家的解体或灭亡。</p><p><strong>（3）主权国家的基本权利:独立权、管辖权、平等权、自卫权等。</strong></p><table><tr><td><p>独立权</p></td><td><p>主权国家拥有按照自己的意志处理内政、外交事务而不受他国控制和干涉的权利</p></td></tr><tr><td><p>管辖权</p></td><td><p>主权国家对其领域内的一切人和物具有管辖的权利</p></td></tr><tr><td><p>平等权</p></td><td><p>主权国家不论大小、强弱，也不论政治、经济、意识形态和社会制度有何差异，在国际法上的地位一律平等</p></td></tr><tr><td><p>自卫权</p></td><td><p>主权国家拥有保卫自己的生存和独立的权利</p></td></tr></table><p>12.中央与地方</p><p>（1）中央政府:一个统一的国家只能有一个中央政府。</p><p><strong>（2）我国行政区域的类型:一般行政地方、民族自治地方和特别行政区。</strong></p><p>（3）中央与地方权力的划分</p><p>中央政府与地方各级政府各自行使自身在法定范围内的权力。中央政府与地方各级政府的权力划分，往往通过国家宪法加以规定。一般而言,中央政府主要负责国家秩序与整体发展、军事、外交等国家级事务,地方各级政府主要负责各自区域内的经济发展、 社会治安等地方性事务。</p><p><strong>（4）我国中央和地方职权划分</strong></p><p><strong>中央和地方各级国家机构按照民主集中制的原则划分职权。一方面,地方利益是国家整体利益的一部分，地方必须服从中央;另一方面，在保证中央统一领导的同时，必须考虑地方特殊利益，充分发挥地方的主动性、积极性。</strong></p><p>13.国家安全与核心利益</p><p>（1）国家安全</p><p>①含义：国家安全是指国家政权、主权、统一和领土完整、人民福祉、经济社会可持续发展和国家其他重大利益相对处于没有危险和不受内外威胁的状态，以及保障持续安全状态的能力。国家安全利益是国家的最高利益。</p><p>②国家安全的核心：国家主权。（它不是一个抽象的、孤立的概念，而是体现在国家的政治、经济、社会文化、军事、外交等诸多方面，抽离任何一方面的内容，都是对国家主权的侵害，也是对国家安全的威胁。）</p><p>③举措：坚持总体国家安全观，以人民安全为宗旨，以政治安全为根本，以经济安全为基础，以军事、文化、社会安全为保障，以促进国际安全为依托，维护各领域国家安全。</p><p><strong>（2）“一国两制”</strong></p><p><strong>①基本内容：在祖国统一的前提下，国家的主体坚持社会主义制度，同时在台湾、香港、澳门保持原有的资本主义制度和生活方式长期不变，享有高度的自治权。</strong></p><p><strong>②香港、澳门两个特别行政区的高度自治权来源于中央授权。高度自治不是完全自治，中央对高度自治权的行使具有监督的权力。坚决防范和遏制外部势力干预港澳事务和进行分裂、颠覆、渗透、破坏活动，确保香港、澳门长治久安。大陆和台湾同属一个中国，这是国际社会的共识。任何旨在制造“台湾独立”的图谋，终究是不能得逞的。</strong></p><p><strong>2.2 单一制和复合制</strong></p><p>14.国家结构形式的含义：指国家的整体与部分、中央与地方之间的相互关系。类型：单一制和复合制</p><p>15.单一制</p><p>（1）中央与地方：中央享有最高权力；地方政权被置于中央政权的统一领导下，只能在宪法和法律规定的权限范围内行使职权。全国只有一个中央政权、一部宪法、一种法律体系。</p><p>（2）组成：按地域划分的普通行政区域或自治区域。</p><p>（3）分类：中央与地方的权力划分：地方分权单一制：如英国，地方有自治权，受中央监督，但不干涉；</p><p>中央集权单一制：如法国，地方无自治权，受控于中央。</p><p>16.复合制（联邦制、邦联制）</p><p>（1）联邦制</p><p>①中央与地方： 国家整体与其组成部分的权限由联邦宪法规定，中央与地方各自在自己的权限范围内享有最高权力并直接行使于人民，相互间不得任意干涉。中央与地方各有其宪法、立法机关、政府、司法系统。</p><p>②各组成部分的权力并非由整体所授予，是它自身作为政治实体所固有的。各组成是享有相对主权的完整政治实体。</p><p><img src="data:image/png;base64,"></p><p>（2）邦联制 ：①含义：邦联是主权国家为某种共同利益而组成的国家联盟。</p><p>②特点：邦联不是真正意义上的国家，不具有完整的国际法主体资格。</p><p>17.国家结构形式的影响因素</p><p>（1）一个国家采用单一制还是复合制的结构形式，是阶级、民族、历史和文化等因素综合起作用的结果。</p><p>（2）人口、领土、政权和主权始终是国家存在和发展的基本条件，也是选择国家结构形式时必须面对的基本问题。</p><p><strong>第二单元 世界多极化</strong></p><p></p><p><strong>第三课 多极化趋势 </strong></p><p><strong>3.1 世界多极化的发展</strong></p><p>18.世界主要力量：美国、中国、欧盟、俄罗斯、日本、印度等新兴国家的兴起。</p><p>（1）冷战结束后，美国成为世界上唯一的超级大国，拥有最强的经济、军事力量，并极力维护其唯一超级大国地位。美国为了维护其在全球的利益，利用军事和经济手段，不断干涉他国内政，输出美国价值观，造成了一系列地区和局部的冲突。</p><p><strong>（2）中国在世界多极化中的地位作用：的实力日益增强。中国坚定地走中国特色社会主义道路，坚持改革方向，综合国力不断增强。中国提出共建“一带一路”倡议，倡导构建人类命运共同体，促进全球治理体系变革。中国的国际影响力、感召力、塑造力进一步提高，日益走近世界舞台的中央，为世界和平与发展作出新的更大的贡献。</strong></p><p>（3）<strong>发展中国家</strong></p><p>是反对霸权主义和强权政治、促进世界和平与发展的重要力量；积极开展南南合作，推进南北合作，共同应对全球性挑战，实现联合自强，成为推动<strong>建立公正合理的国际政治经济秩序的主力军。</strong></p><p>19.世界多极化的形成和发展</p><p>（1）<strong>世界多极化深入发展是当今国际形势的一个突出特点。</strong>多极化发展，是建立在多种力量相互依存又相互制约基础上的,有利于世界的和平与发展。单极与多极的矛盾将在一个相当长的时期内存在。</p><p>（2）在世界多极化加速推进过程中，传统国际体系正在发生深刻变革与调整。随着经济全球化的发展，发展中国家和新兴大国力量逐渐增强，国际关系朝着民主化方向发展。</p><p><strong>3.2 国际关系</strong></p><p><strong>20.国际关系</strong></p><p>（1）含义：国际关系是指国家之间、国际组织之间以及国家与国际组织之间的关系。其中，最主要的是国家与国家之间的关系。</p><p><strong>（2）内容：包括政治、经济、文化、军事关系等。</strong></p><p><strong>（3）基本形式：竞争、合作与冲突。</strong></p><p>（4）<strong>国际交往的主要方式：</strong>包括国家间的贸易往来，文化、科技、教育、医疗等方面的交流，外交磋商，领导人互访，缔结条约或协定，等等。</p><p>（5）行为规则：国际法</p><p>国际交往中，各国逐渐以条约和习惯做法为基础，发展出了一些被普遍遵守的行为规则，被称作国际法。当前，国际法规范着国际交往的各个方面和人类活动的各个领域，对维护国际关系稳定，促进世界和平与发展发挥着重要作用。遵守国际法符合各国的共同利益。</p><p><strong>21.国际竞争的实质：是以经济、军事和科技实力为基础的综合国力的较量。</strong></p><p>22.影响国际关系的主要因素</p><p>（1）国家间分离聚合、亲疏冷热的复杂关系是国家利益、国家实力、宗教、文化和历史等因素综合作用的结果。</p><p><strong>（2）国家利益和国家实力是影响国际关系的决定性因素。</strong></p><p><strong>国家利益是该国统治阶级意志和利益的体现。国家间的共同利益是国家合作的基础，利益对立则是引起国家冲突的根源。维护国家利益是主权国家对外活动的出发点和落脚点。任何国家都不应以维护本国国家利益为由,侵犯别国的主权和安全，干涉别国内政。我国在维护维护自身利益的同时，兼顾他国合理关切，在谋求本国发展中促进各国共同发展。</strong></p><p>23.中国坚定维护自身国家利益</p><p>（1）我国的核心国家利益包括：国家主权，国家安全，领土完整，国家统一，中国宪法确立的国家政治制度和社会稳定，经济社会可持续发展的基本保障等利益。国家安全利益是国家的最高利益。</p><p><strong>（2）为什么要坚定地维护自己的国家利益？</strong></p><p><strong>维护国家利益是主权国家对外活动的出发点和落脚点。我国是人民当家作主的社会主义国家，国家利益与人民的根本利益相一致，维护我国的国家利益就是维护人民的根本利益。</strong></p><p><strong>（3）如何维护国家利益？</strong></p><p><strong>①维护国家利益的有力保障是强大的国家实力。我国应该坚持以经济建设为中心，大力推进科技创新，增强核心竞争力，提升国家实力。</strong></p><p><strong>②我国在维护维护自身利益的同时，兼顾他国合理关切，在谋求本国发展中促进各国共同发展。</strong></p><p><strong>（4）我们如何坚定地维护我国的国家利益？</strong></p><p><strong>①树立国家观念、民族意识,增强民族自豪感、自尊心、自信心;</strong></p><p><strong>②努力学习科学文化知识,提高自身素质;</strong></p><p><strong>③自觉履行维护国家统一和民族团结,维护国家安全、荣誉和利益,同一切损害国家利益的行为作斗争。</strong></p><p><strong>第四课 和平与发展 </strong></p><p><strong>4.1时代的主题</strong></p><p><strong>24.和平与发展是当今时代的主题</strong></p><p>（1）和平问题：指维护世界和平，防止新的世界战争的问题。</p><p>①重要性：是人类社会存在和发展的基本条件；给各国经济发展和其他全球性问题的解决创造必要的前提。</p><p>②现状：第二次世界大战后，国际形势总体稳定，争取较长时期的和平的国际环境具有了现实可能性。</p><p>（2）发展问题：指世界经济的发展问题，特别是发展中国家经济的发展问题。</p><p>特点:世界经济发展的规模和速度超越了以往任何时期。经济全球化是当今世界的一个基本特征；世界经济发展更加注重提高质量，知识经济方兴未艾，经济可持续发展日益受到关注。</p><p>（3）和平与发展的关系：</p><p>①和平是发展的前提。和平的环境,为各国正常发展和政治经济的往来提供保障。</p><p>②发展是和平的基础。 发展是解决一切问题的总钥匙。世界各国的共同发展,才能为国际社会的持久和平提供坚实的物质基础。经济发展有助于消除贫困，减少地区冲突，消除不稳定因素，为维系持久和平提供动力。</p><p><strong>P35探究与分享:对中国来说，为什么维护和平是我们的责任和担当?</strong></p><p><strong> （1）我国人民民主专政的国家性质决定了维护和平是我们的责任和担当；</strong></p><p><strong> （2）维护国家利益是主权国家对外活动的出发点和落脚点，维护和平符合我国的国家利益；</strong></p><p><strong> （3）和平与发展是当今时代主题,维护和平不仅符合中国人民的根本利益, 而且符合全人类的根本利益；维护和平是我们的责任和担当。</strong></p><p>25.促进和平与发展的因素</p><p>（1）经济全球化发展使各国相互依赖。共同维护世界和平与发展的意愿不断增强。</p><p>（2）不同力量中心之间相互制衡。发展中国家力量不断增强，新兴经济体实力提升，壮大了维护世界和平、促进共同发展的力量。科学技术的进步，极大地改变了国际关系和战争面貌。</p><p>（3）谈判与对话成为解决冲突的主要手段。</p><p><strong>4.2 挑战与应对</strong></p><p>26.和平与发展障碍</p><p>（1）<strong>和平与发展的主要障碍----霸权主义和强权政治</strong></p><p>①霸权主义和强权政治含义：某些国家打着“自由”“民主”“人权” “价值观”的幌子,侵犯别国主权,干涉别国内政；凭借经济实力和军事实力对他国进行控制、干涉或侵略。</p><p>②危害：将本国利益凌驾于其他国家的合法利益之上，凭借本国经济、军事等方面的优势，或利用国际旧秩序不合理的制度设计，对其他国家进行控制、干涉或者侵略，在损害他国利益的同时,造成世界的动荡不安。</p><p>（2）南北发展不平衡</p><p>不公正、不合理的国际经济旧秩序还在损害着发展中国家的利益。发展中国家和发达国家的贫富差距越来越大；发展中国家比较普遍地存在贫穷和饥饿现象；落后、贫困、危机等挥之不去的阴影仍然与人类相伴随；<strong>全球发展的最突出问题是南北发展不平衡。</strong></p><p>（3）全球性问题突出：当今世界，局部动荡频繁发生，粮食安全、能源资源安全、网络安全、贸易摩擦、恐怖主义等全球性问题更加突出。</p><p>（4）出现非传统安全威胁。</p><p><strong>27.如何推动世界和平与发展？</strong></p><p><strong>（1）世界各国应该共同维护以《联合国宪章》宗旨和原则为核心的国际秩序和国际体系，推动建设相互尊重、公平正义、合作共赢的新型国际关系;</strong></p><p><strong>（2）坚决反对霸权主义和强权政治，建立以和平共处五项原则为基础的国际新秩序，推动国际秩序朝着更加公正合理的方向发展；</strong></p><p><strong>（3）倡导国际关系民主化。</strong></p><p>28.国际关系民主化--面对影响和平与发展的诸多挑战，中国倡导国际关系民主化。</p><p>（1）什么是国际关系民主化：世界的命运必须由各国人民共同掌握,世界上的事情应该由各国政府和人民在平等互利的基础上,共同商量着办。和平、发展、合作是国际关系民主化的本质特征。</p><p><strong>（2）为什么倡导国际关系民主化？</strong></p><p><strong>国际关系民主化是世界和平的重要保证。国家不分大小、贫富,都是国际社会的平等一员。各国的事应由本国政府和人民决定,国际上的事应由各国政府和人民平等协商。</strong></p><p><strong>（3）如何推进国际关系民主化？</strong></p><p><strong>①在事关世界和地区和平的重大问题上，应该按照《联合国宪章》的宗旨和原则以及公认的国际关系基本准则，坚持通过协商谈判和平解决争端。</strong></p><p><strong>②应该承认世界的多样性，尊重各国的历史文化、社会制度和发展道路。</strong></p><p><strong>③国际社会应该旗帜鲜明地反对霸权主义和强权政治，共同推动建立适应国际力量对比新变化的全球治理体系，更好保障广大发展中国家的发展权益，更好维护广大发展中国家的正当利益，共同推进国际关系民主化。</strong></p><p><strong>第五课 中国的外交 </strong></p><p><strong>5.1 中国外交政策的形成与发展</strong></p><p><strong>29.独立自主的和平外交政策</strong></p><p><strong>（1）决定因素：我国的国家性质和国家利益决定了我国奉行独立自主的和平外交政策。</strong></p><p><strong>（2）我国外交政策的主要内容</strong></p><p><strong>基本立场：独立自主。</strong></p><p><strong>基本目标：维护我国的主权、安全和发展利益，促进世界的和平与发展。</strong></p><p><strong>宗旨：维护世界和平、促进共同发展。</strong></p><p><strong>基本准则：和平共处五项原则。和平共处五项原则是我国外交政策的基石，是对外关系的基本准</strong>则。</p><p>30.中国特色大国外交发展历程</p><table><tr><td><p>时间</p></td><td><p>发展历程</p></td></tr><tr><td><p>党的十一届三中全会以后</p></td><td><p>根据国际形势的变化，党中央对我国外交战略进行重大调整，使其服务于社会主义现代化建设。我国独立自主的和平外交政策更加成熟和完善，我国对外活动进入了更为活跃的时期</p></td></tr><tr><td><p>党的十八大 以来</p></td><td><p>面对深刻变化的国际形势，党中央深刻把握新时代中国和世界发展大势，在对外工作上进行一系列重大理论和实践创新，形成了习近平外交思想</p></td></tr><tr><td><p>党的十九届四中全会</p></td><td><p>对坚持和完善独立自主的和平外交政策、推动构建人类命运共同体进行了部署，提出要健全党对外事工作领导体制机制，完善全方位外交布局，推进合作共赢的开放体系建设，积极参与全球治理体系改革和建设</p></td></tr><tr><td><p>结论</p></td><td><p>中国是维护世界和平与稳定的积极因素和坚定力量，是促进世界经济发展的重要力量。中国在国际事务中的代表性和话语权进一步增强，发挥着重要的建设性作用</p></td></tr></table><p>31.习近平外交思想</p><p>①指导意义（作用）：为新时代中国外交提供了根本遵循和行动指南，为探索解决当今世界各种复杂问题指明方向。 </p><p>②核心要义（主要内容）：习近平外交思想是一个完整的理论体系，以“十个坚持”明确了新时代中国外交的使命宗旨、根本原则、主要任务和独特风格。</p><table><tr><td colspan="2"><p>“十个坚持”为习近平外交思想的总体框架和核心要义</p></td></tr><tr><td><p>根本保证</p></td><td><p>坚持以维护党中央权威为统领加强党对对外工作的集中统一领导</p></td></tr><tr><td><p>历史使命</p></td><td><p>坚持以实现中华民族伟大复兴为使命推进中国特色大国外交</p></td></tr><tr><td><p>总目标</p></td><td><p>坚持以维护世界和平、促进共同发展为宗旨推动构建人类命运共同体</p></td></tr><tr><td><p>根本要求</p></td><td><p>坚持以中国特色社会主义为根本增强战略自信</p></td></tr><tr><td><p>管总规划</p></td><td><p>坚持以共商共建共享为原则推动“一带一路”建设</p></td></tr><tr><td><p>基本原则</p></td><td><p>坚持以相互尊重、合作共赢为基础走和平发展道路</p></td></tr><tr><td><p>重要内涵</p></td><td><p>坚持以深化外交布局为依托打造全球伙伴关系</p></td></tr><tr><td><p>努力方向</p></td><td><p>坚持以公平正义为理念引领全球治理体系改革</p></td></tr><tr><td><p>出发点和</p><p>落脚点</p></td><td><p>坚持以国家核心利益为底线维护国家主权、安全、发展利益</p></td></tr><tr><td><p>精神标识</p></td><td><p>坚持以对外工作优良传统和时代特征相结合为方向塑造中国外交独特风范</p></td></tr></table><p>32.构建新型国际关系</p><p>（1）新时代中国特色大国外交要推动构建新型国际关系，推动构建人类命运共同体。</p><p>（2）构建新型国际关系，就是要坚持合作共赢相处之道，坚持互利共赢的开放和发展战略，把合作共赢理念体现在对外合作的方方面面。在此基础上，我们要推动国际关系民主化，由各国共同制定国际规则，共同参与全球事务，共同享受发展成果，倡导共商共建共享的全球治理观。</p><p><strong>5.2 构建人类命运共同体</strong></p><p>33.构建人类命运共同体</p><p>（1） 必要性：当今世界全球治理体系与国际秩序变革加速推进,世界各国相互联系与依存程度日益加深。世界面临的不稳定性与不确定性突出,人类面临许多共同挑战。各国人民应同心协力,构建人类命运共同体。</p><p>（2）构建人类命运共同体的内涵：</p><p>①坚持对话协商,建设一个持久和平的世界; （政治）②坚持共建共享,建设一个普遍安全的世界; （安全）</p><p>③坚持合作共赢,建设一个共同繁荣的世界; （经济）④坚持交流互鉴,建设一个开放包容的世界; （文化）</p><p>⑤坚持绿色低碳,建设一个清洁美丽的世界。（生态）</p><p>（3）推动构建人类命运共同体的具体要求：</p><p>①政治上：要相互尊重、平等协商,坚决摒弃冷战思维和强权政治,走对话而不对抗、<strong>结伴而不结盟</strong>的交往新路。</p><p>②安全上：坚持以对话解决争端、以协商化解分歧,统筹应对传统和非传统安全威胁,反对一切形式的恐怖主义。</p><p>③经济上：促进贸易投资自由化便利化,推动经济全球化朝着更加开放、包容、普惠、平衡、共赢的方向发展。</p><p>④文化上:要尊重世界文明多样性,以文明交流超越文明隔阂、文明互鉴超越文明冲突、文明共存超越文明优越。</p><p>⑤生态上：要坚持环境友好,合作应对气候变化,保护好人类赖以生存的地球家园。</p><p><strong>（4）推动构建人类命运共同体思想的意义</strong></p><p><strong>①继承和发展了新中国不同时期重大外交思想和主张；反映了中外优秀文化和全人类共同价值追求。</strong></p><p><strong>②适应了新时代中国与世界关系的历史性变化；指明了世界发展和人类未来的前进方向。</strong></p><p><strong>③构建人类命运共同体思想，为全球生态文明建设、国际和平事业、完善全球治理体系、构建全球公平正义的新秩序贡献了中国智慧和中国方案。</strong></p><p><strong>（5）中国行动：构建人类命运共同体，关键在行动</strong></p><p><strong>①中国坚持对外开放的基本国策：以“一带一路”为重点，坚持将引进来与走出去相结合，遵循共商共建共享原则，形成陆海内外联动、东西双向互济的开放格局。</strong></p><p><strong>②支持多边贸易体制：促进自由贸易区建设，打造国际合作新平台，增添共同发展新动力。</strong></p><p><strong>③积极开展公共外交，注重塑造我国文明大国，负责任大国形象。</strong></p><p>【知识整合】：人类命运共同体思想的贯彻落实</p><p>(1)为全球生态及和平事业、变革全球治理体系、构建全球公平正义的新秩序贡献了中国智慧和中国方案；</p><p>(2)就全球治理来讲：我们提出了共商、共建、共享的全球治理观；</p><p>(3)就经济全球化而言：提出了更加开放、包容、普惠、平衡、共赢的发展方向；</p><p>(4)国际关系方面：我们提出了坚持正确义利观的外交理念,构建相互尊重、公平正义、合作共赢的新型国际关系；</p><p>(5)就全球安全来看：我们积极倡导共同、综合、合作、可持续的新安全观；</p><p>(6)在推进国际合作方面：提出共建“一带一路”倡议并付诸实践、取得积极成效；</p><p>(7)构建总体稳定、均衡发展的大国关系框架；坚持按照亲诚惠容的理念，深化同周边国家的互利合作。</p><p><strong>第三单元 经济全球化</strong></p><p><strong> 第六课 走进经济全球化 </strong></p><p><strong> 6.1 认识经济全球化</strong></p><p> 34.经济全球化</p><p>（1）含义：商品、服务及技术、资金、劳务等要素，在全球范围内迅速流动和广泛配置，世界经济出现了高度融合的局面，这就是经济全球化。</p><p><strong>（2）主要表现：生产全球化、贸易全球化和金融全球化。</strong></p><p>（3）最主要、最鲜明的特征：各国经济高度对外开放、 深度相互依赖、全面相互融合。</p><p>（4）影响经济全球化的主要因素</p><p>经济全球化加速发展的根本动因是世界各国对本国本民族利益的追求。市场经济体制为经济全球化奠定了体制基础。经济全球化是社会生产力发展的客观要求和科技进步的必然结果。</p><p><strong>35.经济全球化的重要载体--跨国公司</strong></p><p> （1）积极作用： 跨国公司在全球范围内到处奔走，推动着生产全球化、贸易全球化、金融全球化的深入发展与国际分工的深化，促进了全球资源配置的优化和全球的科技合作与进步。</p><p>（2）消极作用：跨国公司的发展可能带来跨国行业垄断，破坏国际市场的公平竞争，向发展中国家转移落后产能和环境污染等负面影响，必须制定相应政策，尽可能减少跨国公司的负面影响。</p><p><strong>6.2 日益开放的世界经济 </strong></p><p> 36.经济全球化的积极影响</p><p>（1）经济全球化是社会生产力发展的产物，又推动着社会生产力的发展。符合经济规律，符合各方利益。</p><p>（2）经济全球化促进商品、服务和生产要素在全球范围内流动，促进国际分工水平提高和国际贸易迅速发展，推动世界范围内资源配置效率提高、科技进步、产业转移与结构升级，为世界经济发展提供强劲动力。</p><p><strong>（3）经济全球化对发展中国家的影响</strong></p><p><strong>①发展中国家参与经济全球化，有利于充分利用国际国内两种资源、两个市场，推动自身经济发展。</strong></p><p><strong>②加速资源在全球范围内的流动，引进资源和技术；吸引外资，扩大就业，充分发挥劳动力资源的优势。</strong></p><p><strong>③投资自由化，推动企业“走出去”，积极参与经济全球化进程。扩大国际市场解决产品销售问题，带动本国经济发展。</strong></p><p>37.经济全球化的消极影响</p><p>经济全球化在给世界各国带来机遇的同时，也给世界经济发展带来了挑战。在经济全球化进程中，世界经济发展面临着不平衡问题，世界经济发展面临着不确定性和风险加剧。面对经济全球化，我们既要抓住机遇，积极参与，又要勇敢迎接挑战，同舟共济，实现合作共赢。</p><p>38.如何让经济全球化更有活力</p><p>（1）要适应经济全球化，引导好经济全球化走向更加开放、包容、普惠、平衡、共赢的方向发展，让不同国家、不同阶层、不同人群共享经济全球化的好处。</p><p>（2）要建设创新型、开放型、联动型、包容型世界经济。</p><p>（3）要遵循平等、开放、合作、共享等一系列原则完善全球治理机制。</p><p></p><p><strong>第七课 经济全球化与中国 </strong></p><p><strong> 7.1 开放是当代中国的鲜明标识</strong></p><p>39.全面开放新格局的形成</p><p>(1)起点：1978年,党的十一届三中全会作出了对外开放的重大决策。</p><p>(2)特点：经过多年发展,我国全方位、宽领域、多层次的对外开放格局和开放型经济体系逐步形成，开放型经济新体制逐步健全。</p><p><strong>40.发展更高层次的开放型经济</strong></p><p><strong>(1)总体要求：继续坚持对外开放的基本国策，更加主动地参与和推动经济全球化进程。</strong></p><p><strong>(2)具体措施</strong></p><p><strong>①要加快转变对外经济发展方式,推动开放朝着优化结构、拓展深度、提高效益方向转变,着力培育开放型经济发展新优势;</strong></p><p><strong>②要形成以技术、品牌、质量、服务为核心的出口竞争新优势,拓展对外贸易,推进贸易强国建设。</strong></p><p><strong>③要实行高水平的贸易和投资自由化便利化政策,放宽市场准入,扩大服务业对外开放,保护外商投资合法权益;④要创新对外投资方式,促进国际产能合作,加快培育国际经济合作和竞争新优势。</strong></p><p>41.坚持独立自主、自力更生的重要性</p><p>对外开放和自力更生好比两条强有力的“腿”，支撑我国经济迈入现代化。我国实行对外开放,必须始终坚持独立自主、自力更生的原则。中国是人口众多的发展中的社会主义大国，任何时候都不能依赖别人搞建设，必须把独立自主、自力更生作为自己的出发点和中华民族自立于世界民族之林的奋斗基点。</p><p>42.如何处理独立自主，自力更生与对外开放的关系?</p><p>（1）既注重对外开放、合作共赢，又强调独立自主、自力更生。增强自主创新能力，实现关键技术可控，把创新主动权和发展主动权牢牢掌握在自己手中。</p><p>（2）坚持独立自主、自力更生是在立足自身发展的基础上实行对外开放，不是闭关自守。我们将坚定不移扩大对外开放，奉行互利共赢的开放战略。</p><p> 43.中国是经济全球化的受益者</p><p>为我国经济社会发展赢得了良好的国际环境，促进了社会主义市场经济体制的建立和健全，推动了开放型经济水平的提高，带动了国内产业结构的优化升级，创造了大量的就业机会，提高了人民群众的收入和生活水平。</p><p>44.中国是经济全球化的贡献者</p><p>(1)中国对全球减贫事业做出重大贡献。</p><p>（2）中国的发展为世界各国的发展提供机遇：</p><p>①中国将为世界各国提供更广阔市场、更充足资本、更丰富产品、更宝贵合作机会，为全球经济的稳定和增长提供了持续强大的推动力；</p><p>②中国同一大批国家的联动发展，使全球经济发展更加平衡。</p><p>③中国改革开放持续推进，为开放型世界经济的发展提供了重要动力。</p><p><strong>45.中国如何推动经济全球化发展？</strong></p><p><strong>（1）中国将以更加开放的姿态,始终做全球发展的贡献者、国际秩序的维护者,促进世界共同发展。</strong></p><p><strong>（2）中国奉行多边贸易体制，反对贸易保护主义，积极参与全球经济治理和规则制定，按照共同制定的规则办事，通过协商为应对共同的挑战找到共赢的解决方案。</strong></p><p><strong>(3)以共建“一带一路”为重点，推动中国与沿线国家共同繁荣。</strong></p><p><strong>第四单元 国际组织</strong></p><p><strong>第八课：主要的国际组织 </strong></p><p><strong> 8.1日益重要的国际组织 </strong></p><p>46.国际组织</p><p>（1）含义：指的是若干国家的政府或民间团体经协商联合建立的经常性组织。国际组织是国际社会的重要成员，主权国家是国际社会的基石。</p><p>（2）产生：国际关系发展到一定历史阶段的产物，反映了生产力发展的水平和要求，适应了经济全球化和世界多极化趋势的要求；是应对日益复杂的共同问题和全人类面临的课题的需要。</p><p>（3）分类</p><table><tr><td rowspan="2"><p>成员性质</p></td><td><p>政府间</p></td><td><p>成员是主权国家或地区的政府</p></td></tr><tr><td><p>非政府</p></td><td><p>成员主要是团体或公民等</p></td></tr><tr><td rowspan="2"><p>地理范围</p></td><td><p>世界性</p></td><td><p>向全世界开放</p></td></tr><tr><td><p>区域性</p></td><td><p>成员限于某一特定的地域范围，或基于某一共同的军事、经济利益，或基于某种共同的文化、宗教、民族背景</p></td></tr><tr><td rowspan="2"><p>职能范围</p></td><td><p>一般性</p></td><td><p>职能范围广泛，涉及政治、经济、文化、社会等方面</p></td></tr><tr><td><p>专门性</p></td><td><p>具有专业技术职能，主要开展科技、文化、教育、卫生等方面的专业技术性活动</p></td></tr></table><p>（4）作用：</p><p>①积极作用：国际组织可以促进国际社会在政治、经济、文化等领域开展交流、协调、合作，调停和解决国际政治冲突和经济纠纷，促进世界和平与发展。</p><p>②消极作用：个别大国依仗实力，力图控制国际组织，使之成为其推行强权政治和霸权主义的工具。</p><p><strong>8.2 联合国</strong></p><p>47.联合国</p><p>（1）地位：联合国 (UN) 是当今世界最具普遍性、代表性和权威性的政府间国际组织。是世界反法西斯斗争胜利的产物，是人类和平进步事业发展的重要里程碑。</p><p>（2）原则：各会员国主权平等；各会员国必须履行宪章规定的义务；各会员国必须以和平方式解决国际争端；各会员国必须避免使用武力或以武力相威胁，不侵害别国的领土完整、政治独立；各会员国对于联合国依宪章规定而采取的行动，应尽力予以协助；联合国不得干涉在本质上属于任何国家内政的事务。</p><p>（3）联合国的主要机构</p><p>①联合国大会：联合国审议机构，每一会员国有一票，重大问题超过2/3的票数才获得通过。</p><p>②安理会：联合国唯一有权采取行动维护国际和平的机构。由5个（中美英法俄）常任理事国和10个（联大选出任期两年）非常任理事国组成。</p><p>③经济及社会理事会：主要关注国际经济、社会、文化、教育、卫生等问题。④托管理事会（已完成使命）。</p><p>⑤国际法院是为和平解决国际争端而设立的主要司法机构。（总部在荷兰海牙）。</p><p>⑥秘书处：负责联合国日常事务，秘书长是联合国的行政首长。</p><p>（4）联合国的作用: 和平、发展、人权是联合国工作三大支柱。</p><p>①联合国在维护世界和平与发展、促进人类文明进步等方面发挥了重要作用。</p><p>②联合国作为集体安全机制的核心，在保障全球安全的国际合作中发挥着不可替代的作用。</p><p>③联合国为世界特别是发展中国家的经济社会发展作出了积极贡献，为人权事业做了大量开创性工作。</p><p>④联合国是实践多边主义的最佳场所，是集体应对各种威胁和挑战的有效平台。</p><p><strong>8.3 区域性国际组织</strong></p><p>48.欧洲联盟（EU）：区域一体化组织的典型</p><p>（1）地位：当今世界一体化程度最高的区域性国际组织，成为世界格局中的重要力量。</p><p>（2）发展过程：经历了从欧洲共同体到经济与货币联盟、再到欧盟的发展过程。冷战结束后，大批中东欧国家加入欧盟。</p><p>（3）宗旨：促进和平，追求公民富裕生活，实现社会经济可持续发展，确保基本价值标准，加强国际合作。</p><p>（4）作用：欧盟与世界上大多数国家建立了外交关系，并力争在重大国际问题和地区热点问题上有所作为。</p><p>（5）中国与欧盟的合作与交往</p><p>中欧各具经济优势，互补性强。四十多年年来，中欧关系发展迅速，欧盟已成为中国最大的贸易伙伴。2003年，中欧建立全面战略伙伴关系，双方政治互信不断深化，经贸联系日益密切，人员交流持续频密。</p><p>49.亚太经合组织</p><p>（1）地位：APEC是亚太地区层级最高、领域最广、最具影响力的经济合作机制。</p><p>（2）宗旨：支持亚太区域经济可持续增长和繁荣，建设活力和谐的亚太大家庭，捍卫自由开放的贸易和投资，加速区域经济一体化进程，鼓励经济技术合作，保障人民安全，促进建设良好和可持续的商业环境。</p><p>（3）组织方式：①承认多样性，强调灵活性、渐进性和开放性。各成员可以结合自身实际情况逐步推进，不承担强制性的条约义务；有较充分的时间逐步地、渐进地推进贸易和投资自由化进程。</p><p>②遵循相互尊重、平等互利、协商一致、自主自愿的原则。奉行开放的地区主义，坚持非歧视原则，不存在共同的对外关税壁垒，不是封闭的贸易集团。</p><p>③单边行动与集体行动相结合。</p><p>（4）中国在亚太经合组织中的地位和作用</p><p>中国在亚太地区举足轻重，是APEC的重要成员。自1991年加入亚太经合组织以来，中国参加了历届部长级会议和历次领导人非正式会议，积极参与各层次领域合作，为促进亚太经合组织的发展作出了积极贡献。</p><p>50.东南亚国家联盟(ASEAN)</p><p>（1）地位：是亚洲最令人瞩目的区域性国际组织。</p><p>（2）发展：东盟于1967年成立，有10个成员国。21世纪以来，东盟在发展过程中，形成了“10+1”，“10+3”、东盟地区论坛、东盟防长扩大会和东亚峰会等机制，成为推进区域合作和一体化建设的重要平台。</p><p>（3）中国与东盟：中国与东盟保持了良好的沟通和合作。2003年，中国与东盟建立了战略伙伴关系。2010年，中国—东盟自贸区全面建成，中国现已成为东盟第一大贸易伙伴。2013年10月，中国倡议与东盟携手建设更为紧密的中国—东盟命运共同体，共同建设：21世纪海上丝绸之路”。</p><p>51.非洲联盟(AU)</p><p>（1）地位：是非洲最重要的区域性合作组织。</p><p>（2）发展：非盟的前身是成立于1963年的非洲统一组织。2002年，非盟正式取代非洲统一组织。目前，非盟有55个成员，最重要的决策由首脑会议作出。</p><p>（3）作用：非盟成立后，在世界上的影响力与日俱增，成为引领非洲国家联合自强、共谋发展的一面旗帜，其领导权威得到非洲国家和国际社会的广泛认可。</p><p>（4）中国与非盟：中国重视发展与非盟的关系。中国与非盟在气候变化，“2030年可持续发展议程”等重大国际问题以及非洲热点问题上保持沟通协调。非盟在涉及中国核心和重大问题上积极支持中国。中国向非盟机构能力建设、有关推和行动和非盟总部会议中心，非洲疾控中心等项目建设提供援助。</p><p><strong>第九课 中国与国际组织 </strong></p><p><strong> 9.1 中国与联合国 </strong></p><p>52.中国在联合国的地位</p><p>（1）中国是联合国创始会员国，也是当代世界最大的发展中国家，是国际政治经济格局中的一支重要力量。</p><p>（2）作为安理会常任理事国，中国在事关和平与安全的重大事务上享有否决权，是联合国中拥有重要影响的国家之一。</p><p><strong>53.中国在联合国的作用</strong></p><p><strong>（1）中国本着自身肩负的重大国际责任，尊重联合国的权威地位，维护宪章的宗旨和原则，积极参加各项工作，在人类和平与发展事业中发挥着建设性的作用。</strong></p><p><strong>(2)中国坚持以多边主义实现共同安全。</strong></p><p><strong>(3)中国坚持以互利合作实现共同繁荣。</strong></p><p><strong>(4)中国是联合国改革的最早倡导者和有力支持者之一。中国主张有利于坚持宪章的宗旨和原则改革，更好的发挥联合国的作用，维护会员国的共同利益；增加发展中国家的代表权和发言权，切实维护其利益。</strong></p><p><strong>9.2 中国与新兴国际组织</strong></p><p>54.二十国集团 (G20) (国际经济合作主要论坛）</p><p>（1）建立的必要性——2008年国际金融危机爆发后，国际社会深感有必要对全球经济进行监管和治理，二十国集团因此成为新的全球经济治理平台。</p><p>（2）特点——二十国集团成员涵盖面广、代表性强，其构成兼顾了发达国家和发展中国家以及不同地域的利益。</p><p>（3）作用——二十国集团主要讨论全球重大经济金融热点问题。每次峰会前不定期举行协调人会议、财长和央行行长会议，以及贸易、劳工就业、农业、能源、数字经济、卫生等专业部长会议。</p><p>（4）中国与二十国集团</p><p>①中国是二十国集团的创始国，也是二十国集团中最大的发展中国，二十国集团是中国参与全球治理的重要平台。</p><p>②中国提出共同构建创新、开放、联动和包容型世界经济的中国主张，倡导平等、开放、合作、共享的全球经济治理观，为促进世界经济增长、完善全球经济治理贡献中国智慧。</p><p>55.金砖国家（BRICS）:巴西、俄罗斯、印度、中国、南非</p><p>（1）金砖国家秉持开放包容、合作共赢的金砖精神,推动各领域务实合作不断深入,深化了团结互信,增进了五国人民福祉,拉紧了利益和情感纽带,为世界经济企稳复苏并重回增长之路作出了突出贡献。</p><p>（2）在金砖国家中，中国的经济体量最大，作用相对突出。中国一直努力推动金砖国家合作机制的形成和不断发展,中国提出以对话合作、共谋发展为宗旨的“金砖+”合作理念。</p><p>（3）金砖国家具有开放性。金砖国家已成为新兴市场和发展中国家加强团结合作、维护共同利益的重要平台。</p><p>56.上海合作组织（SCO）</p><p>（1）上合组织的产生——1996年，中国、俄罗斯、哈萨克斯坦、吉尔吉斯斯坦、塔吉克斯坦五国元首在上海举行首次会晤，建立“上海五国”会晤机制；2001年乌兹别克斯坦加入，六国元首签署《上海合作组织成立宣言》，宣布上海合作组织成立。 </p><p>（2）上合组织的性质——上海合作组织 （简称“上合组织”）上合组织是第一个在中国境内宣布成立、第一个以中国城市命名的国际组织。上合组织工作语言为汉语和俄语，秘书处设在北京。</p><p>（3）“上海精神”——在互信、互利、平等、协商、尊重多样文明、谋求共同发展的“上海精神”指引下，上合组织开创了自冷战结束以来区域合作的新模式，成为当今世界区域合作的典范。</p><p>（4）合作领域——上合组织自成立之初就将打击“三股势力”（恐怖主义、分裂主义和极端主义势力）、维护地区安全稳定视为重要的合作领域。上合组织地区反恐怖机构执行委员会作为上合组织的常设机构，在国际反恐领域的影响力与日俱增。</p><p>57.亚洲基础设施投资银行</p><p>（1）产生——亚洲基础设施投资银行（简称“亚投行”，英语缩写为“AIIB”）是中国倡议成立的多边金融合作机构。2016年1月，亚投行正式运营。总部设在北京，工作语言为英语。</p><p>（2）亚投行与中国——亚投行是中国倡议成立的多边金融合作机构。中国成为亚投行第一大股东和投票权占比最高的国家。亚投行首任行长也是中国人。（相关链接）</p><p>（3）作用——亚投行致力于亚洲地区基础设施建设，为相关工程项目提供资金支持。 运作原则——公开、透明、独立、问责。目标——精简、廉洁、绿色。</p><p>（4）运行——亚投行制定和实施严格的规章制度，提高透明度和包容性。亚投行在现行国际经济金融秩序下运行，同其他全球和区域多边开发银行的关系是相互补充而非相互替代。</p>',367)]))}const Q=p(s,[["render",I]]);export{S as __pageData,Q as default};
